import HomeSlider from '../../components/HomeSlider/HomeSlider';
import Usluge from '../../components/Sections/Usluge/Usluge';
export default class Pocetna extends Component {
	render() {
		return (
			<React.Fragment>
				<HomeSlider />
				<Usluge />
			</React.Fragment>
		);
	}
}
